// src/index.js
import React from "react";
import ReactDOM from "react-dom";
import "./index.css"; // Untuk gaya global
import App from "./App"; // Mengimpor komponen utama

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root") // Mengikat ke elemen <div id="root"> di index.html
);
